const styles = (theme) => ({
    title: {
        marginBottom: theme.spacing(0.25),
    },
    openInNewOutIcon: {
        position: 'absolute',
        right: 0,
        top: 0,
        bottom: 0,
        margin: 'auto'
    }
});

export default styles;
